import React from 'react';
import './About.css';

const About = () => {
  return (
    <>
    <div className="about_container">
        <div className="about_heading_hr">
        <h1>About Me</h1> &nbsp;&nbsp;&nbsp;&nbsp;
        <hr />
        </div>
    </div>
    </>
  )
}

export default About
